import { makeStyles } from '@material-ui/core/styles';
// import { NONAME } from 'dns';

export default makeStyles({
    tablecreate: {
        backgroundColor: 'rgb(204, 255, 221)',
        borderColor: 'rgb(0, 128, 43)',
        borderStyle: 'solid',
        borderWidth: 5,
        fontFamily: 'Arial',
        fontSize: 19,
        color: 'red',
    },
    buttondone: {
        color: 'purple',
        borderColor: 'rgb(0, 128, 43)',
    },
});
